const Button1 = ({
  variants = "primary",
  size = "medium",
  children,
  type = "button",
  style,
  onClick,
  label,
  icon,
  iconName,
  iconStyle,
  iconEnd,
}) => {
  return (
    <>
      <button
        {...children}
        type={type}
        style={style`${iconEnd} && 'flex-direction: row-reverse'`}
        onClick={onClick}
        className={`btn btn-${variants} btn-${size}`}
      >
        {icon && <img src={icon} alt={iconName} style={iconStyle} />}
        <span>
          {label && label} {children}
        </span>
      </button>
    </>
  );
};

export default Button1;
